import { Box, Typography } from "@mui/material";
import MyButton from '../../../components/MyButton'

const Header = () =>{
    return(
        <Box sx={{margin: "16px 0px;", display:'flex', justifyContent:'center', alignItems:'center', height:'100vh', opacity:0.5, flexDirection:'column',textAlign:'center'}}>
            <Typography sx={{fontSize:"24px", letterSpacing:'6px', fontFamily:'Raleway', margin:'10px 0', fontWeight:'400'}}>
                PHOTOGRAPHER
            </Typography>
            <Typography sx={{fontSize:"36px", letterSpacing:'6px', fontFamily:'Raleway', margin:'10px 0', fontWeight:'400'}}>
                John Doe
            </Typography>
                           
                    <MyButton text="Home"/>
                    <MyButton text="Home"/>
                    <MyButton text="Home"/>
                    <MyButton text="Home"/>
               
        </Box>
    );
}

export default Header
